        <link href="https://unpkg.com/tailwindcss@^1.0/dist/tailwind.min.css" rel="stylesheet">
        <link href="https://fonts.googleapis.com/css2?family=Roboto:ital,wght@0,400;0,500;0,700;1,400;1,500;1,700&display=swap" rel="stylesheet">
        <style>
            :root {
                --text-color: #242529;
                --bg-color: #fff;
                --dark-mode-text-color: #f6f7f8;
                --dark-mode-bg-color: #161618;
            }

            html, body {
                font-family: 'Roboto', sans-serif;
                min-height: 100%;
                height: 100%;
            }
            body {
                color: var(--text-color);
                background: var(--bg-color);
            }
            body.dark-mode {
                color: var(--dark-mode-text-color);
                background: var(--dark-mode-bg-color);
            }
            .cover {
                height: 25vw;
                min-height: 10rem;
                max-height: 204px;
            }
            .cover > div {
                background: linear-gradient(rgba(0,0,0,.5), rgba(138,150,163,0));
            }

            image-post .post-image {
                max-height: calc(100vh - 100px);
                object-fit: cover;
            }

            video-post video {
                max-height: calc(100vh - 100px);
            }

            post {
                display: block;
            }
            post:not(:last-child) {
                border-bottom-width: 1px;
                border-color: rgba(138,150,163,0.2);
                margin-bottom: 1.5rem;
            }

            .thumbnails-carousel {
                display: flex;
                max-width: 100%;
                overflow-x: auto;
            }

            .thumbnails-carousel > a:not(:last-child) {
                margin-right: 0.25rem;
            }

            .w-100px {
                width: 100px;
            }
            .h-100px {
                height: 100px;
            }

            .w-50px {
                width: 50px;
            }
            .h-50px {
                height: 50px;
            }

            p {
                margin-top: 10px;
                margin-bottom: 10px;
            }

            ::-webkit-scrollbar {
                width: 8px;
                height: 8px;
            }
            
            ::-webkit-scrollbar-thumb {
                border-radius: 4px;
                background-color: rgba(134, 134, 134, 0.4);
            }

            .blur-filter {
                top: -5px;
                left: -5px;
                right: -5px;
                bottom: -5px;
                filter: blur(5px) opacity(80%);
            }

            .verified-icon {
                display: inline-block;
                height: 1rem;
                width: 1rem;
                vertical-align: middle;
                fill: currentColor;
            }

            .color-mode-switch {
                position: fixed;
                top: 3em;
                right: 0;
                width: 2em;
                height: 2em;
                border-top-left-radius: 0.25em;
                border-bottom-left-radius: 0.25em;
                padding: 0.3em;
                cursor: pointer;
                border: 1px solid rgba(138,150,163,0.2);
                border-right-width: 0px;
            }
            .color-mode-switch .color-mode {
                display: block;
                width: 100%;
                height: 100%;
                background-color: var(--dark-mode-bg-color);
            }
            .dark-mode .color-mode-switch .color-mode {
                background-color: var(--bg-color);
            }

            .avatar {
                border-color: #fff;
            }
            .dark-mode .avatar {
                border-color: var(--dark-mode-bg-color);
            }

            .progress {
                background-color: rgba(0, 175, 240, 0.12);
                z-index: -1;
            }

            .poll, .poll > div {
                border-color: rgba(138,150,163,0.2);
            }

            .border-color {
                border-color: rgba(138,150,163,0.2);
            }

            .poll-data {
                background-color: rgba(138, 150, 163, 0.08);
            }

            .inline-list > span:not(:first-child):before {
                content: ' • '
            }
        </style>
        <style>
            /**
             * Spinner from https://tobiasahlin.com/spinkit/
             */
            .spinner {
                width: 40px;
                height: 40px;

                position: relative;
            }

            .double-bounce1, .double-bounce2 {
                width: 100%;
                height: 100%;
                border-radius: 50%;
                background-color: #18B8F0;
                opacity: 0.6;
                position: absolute;
                top: 0;
                left: 0;
                
                -webkit-animation: sk-bounce 2.0s infinite ease-in-out;
                animation: sk-bounce 2.0s infinite ease-in-out;
            }

            .double-bounce2 {
                -webkit-animation-delay: -1.0s;
                animation-delay: -1.0s;
            }

            @-webkit-keyframes sk-bounce {
                0%, 100% { -webkit-transform: scale(0.0) }
                50% { -webkit-transform: scale(1.0) }
            }

            @keyframes sk-bounce {
                0%, 100% { 
                    transform: scale(0.0);
                    -webkit-transform: scale(0.0);
                } 50% { 
                    transform: scale(1.0);
                    -webkit-transform: scale(1.0);
                }
            }
        </style>
    </head>
    <body>
        <script>
            let isDarkMode = localStorage.getItem('OnlyFans-backup-color-mode') === 'dark'
            if (isDarkMode) {
                document.body.classList.add('dark-mode')
            }
        </script>
        <div class="h-full w-full flex flex-col justify-center items-center">
            <div class="spinner">
                <div class="double-bounce1"></div>
                <div class="double-bounce2"></div>
            </div>
        </div>

        <template id="app">
            <div if.bind="!noData" class="w-full md:w-4/5 lg:w-1/2 xl:w-10/12 mx-auto md:px-2">
                <cover cover-data.bind="coverData"></cover>
                <creator-card creator-card-info.bind="creatorCardInfo"></creator-card>
                <div class="posts" if.bind="posts != null">
                    <div class="mb-8 uppercase font-medium font-2xl px-4 md:px-0">${posts.length} post${posts.length !== 1 ? 's' : ''}</div>
                    <post post.bind="post" creator.bind="creator" repeat.for="post of posts"></post>
                </div>
            </div>
            <div if.bind="noData" class="h-full w-full flex flex-col justify-center items-center">
                <h1 class="text-2xl font-bold mb-2">Unable to read data from data.json.js file</h1>
                <div class="text-gray-600">Check if the file is present in the same directory, else, check the console for any error.</div>
            </div>
            <div class="color-mode-switch" click.trigger="switchColorMode()"><div class="color-mode"></div></div>
        </template>
        <template id="cover">
            <div class="cover cover-image bg-cover bg-center md:rounded-b-md" style.bind="{ 'background-image': coverData.coverUrl ? ('url(' + coverData.coverUrl + ')') : undefined }">
                <div class="pt-2 px-4 pb-16 text-white">
                    <div class="text-xl font-medium">
                        ${ coverData.name }

                            <div class="relative m-2">

                    <div class="text-sm mt-4 px-4 md:px-0">
                        <span class="font-medium">${ post.favoritesCount }</span> like${ post.favoritesCount != 1 ? 's' : '' }

                    </div>
                </div>
            </div>
        </template>
        <template id="media-display">
            <a if.bind="media[0].type === 'photo'" class="w-full" href.bind="media[0].full" target="_blank">
                <img class="w-full post-image ${ media.length !== 1 ? 'md:rounded-md' : 'md:rounded-t-md' }" src.bind="media[0].preview">
            </a>
            <div if.bind="media[0].type === 'video'" class="relative overflow-hidden ${ media.length !== 1 ? 'md:rounded-md' : 'md:rounded-t-md' }">
                <div class="absolute bg-cover blur-filter" style.bind="{ 'background-image': 'url(' + media[0].preview + ')', 'z-index': '-1' }"></div>
                <video class="w-full" poster.bind="media[0].preview" src.bind="media[0].full" controls></video>
            </div>
            <div class="thumbnails-carousel mt-1 pb-1" if.bind="media.length > 1">
                <a repeat.for="image of media | from: 1" href.bind="image.full" target="_blank">
                    <img class="w-auto h-32 max-w-none md:rounded-md" src.bind="image.preview">
                </a>
            </div>
            <div if.bind="!post.canViewMedia" class="background-image bg-cover bg-center p-4 ${ media.length !== 1 ? 'mt-1 md:rounded-md' : 'md:rounded-b-md'}">
                <div class="border border-color p-4 rounded flex justify-between">
                    <div class="inline-list text-sm text-gray-600">
                        <span if.bind="imagesCount > 0">${ imagesCount } image${ imagesCount !== 1 ? 's' : ''}</span>
                        <span if.bind="videoDuration > 0">${ videoDuration | duration } video</span>
                    </div>
                    <div class="text-gray-600 opacity-75 text-sm">$${ post.price }</div>
                </div>
            </div>
        </template>

    <script src="./data.json.js" charset="UTF-8"></script>
    <script>
        function startApp() {
            var aurelia = new au.Aurelia();
            aurelia
                .use
                .standardConfiguration()
                .globalResources([FromValueConverter, DurationValueConverter])
                .developmentLogging();

            return aurelia
                .start()
                .then(function() {
                    return aurelia.setRoot(App, document.body);
                });
        }
        function App() {
            this.posts = [];

            this.switchColorMode = () => {
                let isCurrentDarkMode = document.body.classList.contains('dark-mode')
                if (isCurrentDarkMode) {
                    document.body.classList.remove('dark-mode')
                } else {
                    document.body.classList.add('dark-mode')
                }
                localStorage.setItem('OnlyFans-backup-color-mode', !isCurrentDarkMode ? 'dark' : 'light')
            }
        }
        App.prototype.activate = function() {
            return (async () => {
                const data = window.onlyFansData
                if (data === undefined) {
                    this.noData = true
                    console.error('window.onlyFansData is undefined')
                    return this
                }
                try {

                    const posts = data.data;

                    this.posts = posts.map((p) => {
                        return {
                            id: p.id,
                            content: p.text,
                            responseType: p.responseType,
                            mediaType: p.mediaType,
                            media: p.media.map((media) => {
                                return {
                                    id: media.id,
                                    type: media.type,
                                    preview: cleanLink(media.preview),
                                    full: cleanLink(media.full),
                                    source: { ...media.source }
                                }
                            }),
                            price: p.price,
                            canViewMedia: p.canViewMedia,
                            preview: [ ...p.preview ],
                            hasVoting: p.hasVoting,
                            voting: { ...p.voting },
                            postedAt: moment(p.postedAt).format('lll'),
                            commentsCount: p.commentsCount,
                            favoritesCount: p.favoritesCount,
                            tipsAmount: +(/\d+\.?\d*/g.exec(p.tipsAmount)?.[0]) > 0 ? p.tipsAmount : null,
                        }
                    })

                    this.coverData = {
                        name: data.creator.name,
                        isVerified: data.creator.isVerified,
                        postsCount: data.creator.postsCount,
                        favoritedCount: data.creator.favoritedCount,
                        coverUrl: cleanLink(data.creator.header)
                    }
                    this.creator = {
                        avatarUrl: cleanLink(data.creator.avatar),
                        name: data.creator.name,
                        username: data.creator.username,
                        isVerified: data.creator.isVerified,
                    }
                    this.creatorCardInfo = {
                        ...this.creator,
                        lastSeen: data.creator.lastSeen ? moment(data.creator.lastSeen).format('lll') : null,
                        about: data.creator.about,
                    }

                    document.title = `${data.creator.name} - OnlyFans Backup`
                } catch (e) {
                    console.error(e)
                    this.noData = true
                }

                return this
            })()
        }

        App.$view = {
            template: au.FEATURE.ensureHTMLTemplateElement(document.querySelector('#app')),
            dependencies: [Cover, CreatorCard, Post]
        }

        function CreatorCard() {}
        CreatorCard.$view = {
            template: au.FEATURE.ensureHTMLTemplateElement(document.querySelector('#creator-card')),
        }
        CreatorCard.$resource = {
            type: 'element',
            bindables: ['creatorCardInfo']
        }

        function Cover() {}
        Cover.$view = {
            template: au.FEATURE.ensureHTMLTemplateElement(document.querySelector('#cover')),
        }
        Cover.$resource = {
            type: 'element',
            bindables: ['coverData']
        }

        function Post() {}
        Post.$view = {
            template: au.FEATURE.ensureHTMLTemplateElement(document.querySelector('#post')),
            dependencies: [MediaDisplay]
        }
        Post.$resource = {
            type: 'element',
            bindables: ['post', 'creator']
        }

        function MediaDisplay() {}
        MediaDisplay.prototype.postChanged = function() {
            this.media = this.post.canViewMedia ? this.post.media : this.post.media.filter(media => this.post.preview.indexOf(media.id) !== -1)
            this.imagesCount = this.post.media.filter(media => media.type === 'photo').length
            this.videoDuration = this.post.media.filter(media => media.type === 'video').reduce((a, b) => a + b.source.duration, 0)
        }
        MediaDisplay.$view = {
            template: au.FEATURE.ensureHTMLTemplateElement(document.querySelector('#media-display')),
        }
        MediaDisplay.$resource = {
            type: 'element',
            bindables: ['post', 'creator']
        }

        function FromValueConverter() {
            this.toView = (array, start) => {
                return array ? array.slice(start) : undefined
            }
        }

        function DurationValueConverter() {
            this.toView = (duration) => {
                const minutes = Math.trunc(duration / 60)
                const seconds = duration % 60
                return `${minutes}:${seconds.toString().padStart(2, '0')}`
            }
        }


        function cleanLink(link) {
            if (typeof link !== "string") {
                return null
            }
            return link.replace(/^https?:\/\//, './').replace(/\?(.*)/, '')
        }

        startApp();
    </script>
